import 'bootstrap/dist/css/bootstrap.min.css';
import { CartProvider } from './context/cartContext';
import Routes from './routes/routes';
import './App.css';
import {DatabaseProvider} from './context/databaseContext';

function App() {
  return <div id="app">
  <DatabaseProvider>
    <CartProvider>
      <Routes />
    </CartProvider>
  </DatabaseProvider>
  </div>
}

export default App;
